import React from "react";
import './ExpenseFilter.css'

function ExpenseFilter(props) {

    return (
        <div className="expenses-filter">
            <div className="expenses-filter__control">
                <label>

                </label>
                <select>
                    <option>2023</option>
                    <option>2022</option>
                    <option>2021</option>
                    <option>2020</option>
                </select>
            </div>

        </div>
    );
}

export default ExpenseFilter;
